import React from "react";

import { Feed, Feeds } from "../utils/Feed";

import '../styles/Content.css';

interface State {
	feeds: string
}

class Content extends React.Component {
	state: State

	constructor(props: any) {
		super(props);

		this.state = {
			feeds: ""
		};
	}

	componentDidMount(): any {
		Feed.getFeeds()
			.then((feeds: Feeds) => {
				console.log(feeds);
				this.setState({
						feeds: feeds
				})
			})
			.catch(error => console.error('patati patata', error));
	}

	render(): any {
		return(
			<div className="Content">
				{this.state.feeds}
			</div>
		);
	}
}

export default Content;
